import React from 'react'
import './App.css'
import bondcliff from './bondcliff.jpg'

const App = () => {
  return (
    <div className="App">
      <img src={bondcliff} className="img" alt="summit" />
      <h1>Rob Richards</h1>
      <h2>Full Stack Software Engineer</h2>
      <h3>Boston, MA</h3>
    </div>
  )
}

export default App;
